import React, { Component } from 'react';
import Recipe from './Recipe';

class Myresults extends Component {

  render() {

    const RecipeList = this.props.myresults.map((recipe, i) => {
      return (<Recipe
        key={i}
        {...recipe}
        />);
      });

      return(
        <div>
        <div>
        {RecipeList}
        </div>
        </div>
      )
    }


  }

  export default Myresults;
